# Check for theta cancelations for all topologies up to n-loops
# Note that the input contains doubles and has support up to 6-point vertices
from multiprocessing import Pool
from ltd_utils import TopologyGenerator
import signal

def check_diagram(diag):
    # create the LTD graph with the external momenta removed
    graph = TopologyGenerator(
        [(None, loop_line[0], loop_line[1]) for loop_line in diag])
    momentum_bases = graph.loop_momentum_bases()

    chosen_basis = momentum_bases[0]
    graph.generate_momentum_flow(chosen_basis)

    # extract the signatures from the momentum flow
    signature_matrix = []
    for loop_line in graph.propagators:
        sig = [0]*len(chosen_basis)
        for mom, sign in loop_line:
            sig[chosen_basis.index(mom)] = 1 if sign else -1
        signature_matrix.append(sig)

    contour_closure = None # fixed for now
    if contour_closure is None:
        # close from below by default
        contour_closure = [0] * len(chosen_basis)

    allowed_systems = graph.find_allowed_systems(
        momentum_bases, signature_matrix)
    residues = graph.evaluate_residues(allowed_systems, contour_closure)
    residues = graph.evaluate_thetas(residues)
    residues = graph.remove_cancelling_residues(residues)

    # generate the cut structure
    #cut_stucture = []
    #for residue, momentum_basis in zip(residues, momentum_bases):
    #    cut_struct_iter = iter(residue[0][1])
    #    cut_stucture += [[next(cut_struct_iter)
    #                        if i in momentum_basis else 0 for i in range(len(diag))]]
    #print(cut_stucture)

